import { useEffect, useState } from 'react';
import { SideBarAdmin } from './SideBarAdmin';
import { DataTable } from 'primereact/datatable';


export function ReceiptTable(){
    const [visible, setVisible] = useState(false);

    const [receipt,setReceipt]=useState()

    useEffect(()=>{
        fetch("http://localhost:8080/receipt",{
            method:"GET"
        })
        .then((res=>res.json()))
        .then((data)=>{

            const {content}=data


            setReceipt(content)





        })


        },[])


    return (

    <>
    <SideBarAdmin visible={visible} onHide={() => setVisible(false)}></SideBarAdmin>
    <DataTable value={receipt} 
            paginator rows={5} 
            rowsPerPageOptions={[5, 10, 25, 50]} 
            tableStyle={{ minWidth: '50rem' }}
            className='card-table'>
            <Column field="id" header="Code" />
                <Column field="user.firstName" header="First Name"/>
                <Column field="user.lastName" header=" Name"/>
                <Column field="user.department" header="Departament"/>
                <Column field="description" header="Description"/>
                <Column body={(ticket) => 
                <div>
                    <Checkbox checked={ticket.ticketState} />
                    {!ticket.ticketState && <Button onClick={() => handleButtonClick(ticket.user.id,ticket.id )} label="Receipt" className='button' />}

                </div>}
                header="Ticket State"/>

            </DataTable>

    </>)

}
